script: |
  super -f text -I q13756.spq | sort > q13756.out

inputs:
  - name: q13756.spq
    data: |
      SELECT - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 IN ( + + 34, col1 - col1 + + 76, + + ( + 89 ), + 9 * - col0 );
  - name: tab1

outputs:
  - name: q13756.out
    data: |
      -14
      -47
      -5
